import{_ as a,a as e,b as r,c as o,d as i,e as n,f as l}from"./chunks/qgc_firmware_standard_vtol_fun_cub_quad.CBKDMaZ8.js";import{_ as s,c as d,a8 as p,o as h}from"./chunks/framework.BDnHobkS.js";const k=JSON.parse('{"title":"Volantex Ranger-Ex QuadPlane VTOL(Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md","filePath":"ko/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"}'),u={name:"ko/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"};function m(c,t,g,x,f,_){return h(),d("div",null,t[0]||(t[0]=[p('<h1 id="volantex-ranger-ex-quadplane-vtol-pixhawk" tabindex="-1">Volantex Ranger-Ex QuadPlane VTOL(Pixhawk) <a class="header-anchor" href="#volantex-ranger-ex-quadplane-vtol-pixhawk" aria-label="Permalink to &quot;Volantex Ranger-Ex QuadPlane VTOL(Pixhawk)&quot;">​</a></h1><p>QuadRanger VTOL은 QuadCopter 시스템으로 설계된 Volantex Ranger-Ex를 기반의 표준 꼬리 비행기입니다. Ranger-Ex는 비행법이 간단한 범용적인 FPV 플랫폼입니다. HobbyKing에서 구매할 수 있으며, Quanum Observer로 제품명이 변경되었습니다. 플라스틱 동체와 2m EPO 날개는 탑재 하중이 높은 견고한 기체입니다.</p><p>주요 정보:</p><ul><li><strong>Frame:</strong> Volantex Ranger-Ex or <em>Quanum Observer</em></li><li><strong>Flight controller:</strong> Pixhawk</li></ul><p><img src="'+a+'" alt="QuadRanger"></p><p>VTOL 변환된 비행기의 중량은 LiPo를 포함하여 약 3.5kg 정도 증가합니다. 변환된 비행기는 약 65%의 추진력으로 순항할 수 있습니다. The suggested quad setup provides a thrust of 7.5kg and the airframe can fly with a total weight of around 4.5kg. FPV 장비와 카메라를 탑재에 충분한 하중 용량을 가지고 있습니다.</p><p>The conversion is designed to minimize impact on the aerodynamics and provide additional strength minimize wing flexing.</p><h2 id="부품-명세서" tabindex="-1">부품 명세서 <a class="header-anchor" href="#부품-명세서" aria-label="Permalink to &quot;부품 명세서&quot;">​</a></h2><ul><li>Volantex Ranger-Ex 혹은 Quanum Observer</li><li>1200KV 530W 모터</li><li>30A 속도 컨트롤러</li><li>4S 배터리</li><li>APC Electric 11x5 프로펠러</li></ul><h2 id="변환-키트" tabindex="-1">변환 키트 <a class="header-anchor" href="#변환-키트" aria-label="Permalink to &quot;변환 키트&quot;">​</a></h2><ul><li>필요한 기본 부품은 다음과 같습니다.</li><li>Pixhawk 또는 호환 제품</li><li>디지털 풍속 센서</li><li>3DR 호환 전원 모듈</li><li>GPS</li></ul><p>For a full parts list with links to Hobbyking EU and International warehouse see: <a href="https://px4.io/wp-content/uploads/2016/01/QuadRanger-VTOL-partslist-1.xlsx" target="_blank" rel="noreferrer">QuadRanger-VTOL-partslist</a></p><p>아래 이미지는 한 날개에 필요한 부품을 보여줍니다.</p><p><img src="'+e+'" alt="QuadRanger Parts"></p><p>The tools required for the conversion are;</p><ul><li>Dremel 또는 유사한 회전 도구</li><li>취미용 칼</li><li>UHU POR 접착제</li><li>CA 접착제</li><li>줄자</li><li>테이프</li></ul><p><img src="'+r+'" alt="QuadRanger conversion tools"></p><h2 id="날개-변환" tabindex="-1">날개 변환 <a class="header-anchor" href="#날개-변환" aria-label="Permalink to &quot;날개 변환&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Please note that the conversion in this build log is performed on a wing that shows damage from a previous conversion.</p></div><p>Cut both 800mm square carbon tubes to a length of 570mm and 230mm.</p><p>Making a slot in the Styrofoam wing 1.5cm deep using a rotary tool with some form of guidance to keep a fixed depth. 슬롯은 230mm 정사각형 탄소 튜브 1 개의 길이, 깊이 및 너비를 유지하여야 합니다. 아래 표시된 위치에 있어야합니다.</p><p><img src="'+o+'" alt="QuadRanger carbon tube slot"></p><p>CA 접착제를 사용하여 300x150x1.5mm 탄소 시트를 230mm 탄소 튜브에 붙이고 전선을 통과할 구멍을 만듭니다. 전원 및 신호용 전선을 ESC에 삽입합니다. UHU POR를 사용하여 시트와 탄소 튜브를 아래 표시된대로 스티로폼 날개에 붙입니다.</p><p><img src="'+i+'" alt="QuadRanger sheet attachment"></p><p>Using CA glue, glue the 570mm square carbon tube to the carbon sheet. It should be located 285mm from where the wings join. 튜브는 날개의 수직 영역을 기준으로 중앙에 있어야 합니다. 양쪽에서 정확히 165mm 연장되어야합니다.</p><p>모터 마운트를 모터에 부착합니다. With another motor mount plate and 4 M3x25mm screws clamp the motor on the end of the square carbon tube as indicated below. 타이 랩이있는 ESC를 카본 튜브에 부착합니다. Afro ESC를 사용할 때는 최소한 신호와 접지선을 연결하십시오.</p><p><img src="'+n+'" alt="QuadRanger motor and esc"></p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>Pixhawk의 출력은 다음과 같이 연결되어야합니다 ( &quot;평면에 앉아 있음&quot;과 같은 방향)</p><table tabindex="0"><thead><tr><th>포트</th><th>연결</th></tr></thead><tbody><tr><td>MAIN 1</td><td>Front right motor, CCW</td></tr><tr><td>MAIN 2</td><td>후방 촤즉 모터, 반시계 방향</td></tr><tr><td>MAIN 3</td><td>전방 좌측 모터, 시계방향</td></tr><tr><td>MAIN 4</td><td>후방 우측 모터, 시계 방향</td></tr><tr><td>AUX 1</td><td>좌측 보조익</td></tr><tr><td>AUX 2</td><td>우측 보조익</td></tr><tr><td>AUX 3</td><td>승강타</td></tr><tr><td>AUX 4</td><td>방향타</td></tr><tr><td>AUX 5</td><td>스로틀</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The servo direction can be reversed using the PWM_REV parameters in the PWM_OUTPUT group of QGroundControl (cogwheel tab, last item in the left menu)</p></div><p>For further instructions on wiring and configurations please see: <a href="./../config_vtol/vtol_quad_configuration.html">Standard VTOL Wiring and Configuration</a></p><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>Configure the frame as shown in QGroundControl below (do not forget to click <strong>Apply and Restart</strong> in the top).</p><p><img src="'+l+'" alt="QGC - select firmware for standard VTOL"></p><h2 id="지원" tabindex="-1">지원 <a class="header-anchor" href="#지원" aria-label="Permalink to &quot;지원&quot;">​</a></h2><p>If you have any questions regarding your VTOL conversion or configuration please visit <a href="https://discuss.px4.io/c/px4/vtol" target="_blank" rel="noreferrer">https://discuss.px4.io/c/px4/vtol</a>.</p>',37)]))}const w=s(u,[["render",m]]);export{k as __pageData,w as default};
